pragma solidity ^0.8.3;

import "../ERC725/ERC725.sol";


contract Executor {

    ERC725 public account;
    // KeyManager public keyManager;

    constructor(address _account) {
        account = ERC725(_account);
        // keyManager = KeyManager(account.owner());
    }

    function test() public returns(bytes memory) {
        bytes32[] memory keys = new bytes32[](1);
        keys[0] = keccak256(abi.encodePacked("MyFirstKey"));
        // create the value
        bytes[] memory values = new bytes[](1);
        values[0] = abi.encode("Hello Lukso!");

        // abi-encode the payload for ERC725
        return abi.encodeWithSelector(
            account.setData.selector,
            keys, 
            values
        );
    }

    function executeSetData() public returns (bool) {
